import React, {Component} from 'react';
import axios from 'axios';

export default class Characters extends Component{
	constructor(props){
		super(props);
		this.state={data:[]}
	}

	componentDidMount(){
		axios.get(`https://us.api.blizzard.com/data/wow/race/index?namespace=static-us&locale=en_US&access_token=${process.env.REACT_APP_WOW_API_KEY.API_KEY}`)
		.then((res)=>{
			console.log(res)
		})
	}
	render(){
		return(
			<h1>I am the characters</h1>
		)
	}
}
